class Solution {
    fun maximumLength(s: String): Int {
        var result = -1
        for (i in s.indices) {
            for (j in i + 1 until s.length) {
                if (s[i] == s[j]) {
                    var k = 1
                    while (i + k < s.length && j + k < s.length && s[i + k] == s[j + k]) {
                        k++
                    }
                    var count = 2
                    for (l in j + k until s.length) {
                        if (s.substring(i, i + k) == s.substring(l, minOf(l + k, s.length))) {
                            count++
                            break
                        }
                    }
                    if (count >= 3) {
                        result = maxOf(result, k)
                    }
                }
            }
        }
        return result
    }
}
